response.activities:
Деловые, переводческие, туристические услуги в Китае:
- устный и письменный перевод с/на китайский язык;
- встреча в аэропорту, размещение в гостинице, бронирование ж/д и авиабилетов;
- поиск китайских поставщиков любой продукции;
- языковое сопровождение в деловых поездках по Китаю;
